    {serversModel?.map((server, index) => (
      <Styled.ServerIconWrapper key={`server-${index}`}>
         <Styled.ServerIcon src={server.image}/>
      </Styled.ServerIconWrapper>
     
    ))}
  </Styled.Container>
}

export default Servers;
